import getQuerystr from '../utils/getQuerystr';
import config from '../config';

function maxWin() {
    RongDesktop.window.max();
}

function minWin() {
    RongDesktop.window.min();
}

function restoreWin() {
    RongDesktop.window.restore();
}

function closeWin() {
    RongDesktop.window.close();
}

function hideWin() {
    if (
        typeof RongDesktop === 'object'
        && typeof RongDesktop.window.hide === 'function'
    ) {
        RongDesktop.window.hide();
    }
}

function showWin() {
    if (
        typeof RongDesktop === 'object'
        && typeof RongDesktop.window.show === 'function'
    ) {
        RongDesktop.window.show();
    }
}

function flashFrame() {
    RongDesktop.window.flashFrame(true);
}

function shakeWindow(options) {
    RongDesktop.window.shakeWindow(options);
}

function displayBalloon(title, options) {
    RongDesktop.window.displayBalloon(title, options);
}

function updateBadgeNumber(count, display) {
    RongDesktop.window.updateBadgeNumber(count, display);
}

function focus() {
    RongDesktop.window.focus();
}
function isVisible() {
    return RongDesktop.window.isVisible();
}
function isFocused() {
    return RongDesktop.window.isFocused();
}

const sound = {
    ringAudio: null,
    playRing() {
        if (!sound.ringAudio) {
            sound.ringAudio = document.createElement('audio');
            sound.ringAudio.loop = true;
            sound.ringAudio.src = 'data:audio/mp3;base64,';
        }
        sound.ringAudio.play();
    },
    stopRing() {
        if (sound.ringAudio) {
            sound.ringAudio.pause();
            sound.ringAudio.currentTime = 0;
        }
    },
};

const browserWin = RongDesktop.browserWin || {};

export default {
    max: maxWin,
    min: minWin,
    restore: restoreWin,
    close: closeWin,
    hide: hideWin,
    show: showWin,
    focus,
    isFocused,
    flashFrame,
    shakeWindow,
    displayBalloon,
    updateBadgeNumber,
    quit: RongDesktop.window.quit,
    isVisible,

    toggleDevTools() {
        RongDesktop.window.toggleDevTools();
    },
    openWork({ conversationType, targetId }, auth) {
        const query = {
            userId: auth.id,
            code: auth.code,
            language: config.locale,
            conversationType,
            targetId,
            productName_zh: config.product.name.zh,
            productName_en: config.product.name.en,
        };

        const querystr = getQuerystr(query);
        const path = `/worker.html?${querystr}`;
        // const work = RongDesktop.work;
        if (browserWin.create) {
            browserWin.create({
                path,
                isLocal: true,
                id: 'RceWork',
                moduleName: config.IM_SUB_MODULE,
            });
        }
        //  else if (work) {
        //     work.open(path);
        // }
    },
    closeWork() {
        browserWin.command({
            winId: 'RceWork',
            commandName: 'close',
        });
    },
    openSealMeeting(id, auth, openVideo, openAudio) {
        function setUserConfigInfo() {
            const webInfo = RongDesktop.configInfo.webInfo;
            webInfo.USER_ID = auth.id;
            webInfo.USER_NAME = auth.name;
            webInfo.PORTRAIT = auth.portrait;
            webInfo.IM_TOKEN = auth.token;
            webInfo.IS_VIDEO_ON = openVideo;
            webInfo.IS_AUDIO_ON = openAudio;
        }

        if (browserWin.create) {
            setUserConfigInfo();
            browserWin.create({
                path: `/#/meeting?meetingId=${id}&from=rce`,
                isLocal: true,
                id: 'sealmeeting',
                autoHideMenuBar: true,
                frame: false,
                moduleName: config.SEALMEETING_SUB_MODULE,
            });
        }
    },
    closeSealMeeting() {
        browserWin.close('sealmeeting');
    },
    getWindow(winId, callback) {
        browserWin.getWindow(winId, callback);
    },
    openPSArticle(url) {
        const querystr = getQuerystr({
            url,
        });
        browserWin.create({
            width: 600,
            minWidth: 600,
            path: `/public-service-article.html?${querystr}`,
            isLocal: true,
            id: 'RCEPSArticle',
            moduleName: config.IM_SUB_MODULE,
        });
    },
    openVersions() {
        // 39331 - 【设置】英文语言模式下，功能介绍及版本更新没有变成英文显示
        const query = {
            language: config.locale,
        };
        const querystr = getQuerystr(query);
        const path = `/versions.html?${querystr}`;
        browserWin.create({
            path,
            isLocal: true,
            width: 800,
            height: 512,
            minWidth: 800,
            minHeight: 512,
            moduleName: config.IM_SUB_MODULE,
        });
    },
    closeAll() {
        const work = RongDesktop.work;
        if (browserWin.closeAll) {
            browserWin.closeAll();
        } else if (work) {
            work.close();
        }
    },
    // 监听应用公众号信息
    enterPublic(router, callback) {
        RongDesktop.ipcRenderer.on('openConversation', (event, params) => {
            RongDesktop.window.focus();
            callback(router, params);
        });
    },
    // sendPublicMessage(params) {
    //     RongDesktop.browserWin.sendCommand(params);
    // },
    sendPublicNotify(params) {
        RongDesktop.browserWin.sendNotify(params);
    },
};
